<?php
namespace app\index\controller;
use think\Db;
use think\Controller;
class Index extends Controller
{
    public function index()
    {
        $str="data:image/png;base64,";
        if (preg_match('/^(data:\s*image\/(\w+);base64,)/', $str, $result)){
            $type = $result[2];
            $new_file = ROOT_PATH . 'public' . DS . 'uploads/';
            if(!file_exists($new_file))
            {
//检查是否有该文件夹，如果没有就创建，并给予最高权限
                mkdir($new_file, 0700);
            }
            $new_file = $new_file.time().".{$type}";
            if (file_put_contents($new_file, base64_decode(str_replace($result[1], '', $str)))){
                echo '新文件保存成功：', $new_file;
            }else{
                echo '新文件保存失败';
            }
        }
        $temp=strtotime($str);
        var_dump($temp);
        return $this->fetch();
    }
    public function post(){
        return $this->fetch();
    }

    /*用户登陆*/
    public function login(){
        $param = input();
        $username = getValue($param,'username');
        $password = getValue($param,'password');
        if(empty($username) || empty($password)){
            return updateResult(0,'用户名和密码不能为空');
        }
        $isRemember = !empty($param['isRemember'])? $param['isRemember']: '';
        $data = model('User')->login($username, $password, $isRemember);
        return updateResult($data,model('User')->getError());
    }


    /*退出登陆*/
    public function logout(){
        $params=input();
        cache('Auth_'.$params['authkey'], null);
        $this->success('退出成功！！');
    }
    /*记住密码自动登陆*/
    public function auto_login(){
        $userModel = model('User');
        $param = input();
        $data = json_decode(encrypt($param['rememberKey'],"DE"),true);
        if($this->request->time()-$data['time']>24*3*60*60){
            return updateResult(0);
        }
        $result = $this->validate($data,'Login');
        if(true !== $result){
            // 验证失败 输出错误信息
            $this->error($result);
        }
        $username = $data['username'];
        $password = $data['password'];
        $data = $userModel->login($username, $password, true, true);
        return updateResult($data);
    }

    /*新手报道*/
    public function news_people(){
        $data=Db::name('user')->field('nickname,user_face_img')->limit(20)->order('create_time desc')->select();
        return updateResult($data);
    }

    /*注册*/
    public function register(){
        $phone=input('phone');
        $password=input('password');
        if(empty($phone)){
            return updateResult(0,'手机号不能为空');
        }
        $captcha=input('code');
        if(!captcha_check($captcha)){
            return updateResult(0,'验证码不正确');
        };
        $data=['phone'=>$phone,'create_time'=>$this->request->time(),'id'=>getGuid(),'password'=>encrypt($password)];
        $result=Db::name('user')->insert($data);
        return updateResult($result);
    }

    /*找回密码*/
    public function forgetPwd(){
        $phone=input('phone');
        $code=input('code');
        if(empty($phone)){
            return updateResult(0,'手机号不能为空');
        }
        if(!captcha_check($code)){
            return updateResult(0,'验证码不正确');
        };
        return updateResult(1);
    }

    /*重置密码*/
    public function czmm(){
        $phone=input('phone');
        $password=input('password');
        $cache=cache('forgetPwdCode_'.$phone);
        if(empty($cache)){
            return updateResult(0,'超时请重新发验证码重试！');
        }

        if(empty($phone)){
            return updateResult(0,'手机号不能为空');
        }
        $data=['password'=>encrypt($password)];
        $result=Db::name('user')->where('phone',$phone)->update($data);
        return updateResult($result);
    }
}
